import { useState } from "react";

function Navbar (props) {
    const [items, setItem] = useState(5);

    return (
        <h2> 
            <tr> 5</tr>
            <tr> 4</tr>
            <input onChange={setItem(items + 1)}> some input place </input>
        </h2>
    );
}
export default Navbar;
